import React, { useState } from 'react';
import { motion } from 'framer-motion';
import './LoveButton.css';

const LoveButton = ({ onClick }) => {
  const [isPressed, setIsPressed] = useState(false);
  const [showSparkles, setShowSparkles] = useState(false);

  const handleClick = () => {
    setIsPressed(true);
    setShowSparkles(true);
    onClick();

    // Reset button state after animation
    setTimeout(() => setIsPressed(false), 300);
    setTimeout(() => setShowSparkles(false), 1000);
  };

  const emojis = ['🩷', '💖', '💕', '💗', '💓', '💝', '💘', '💞', '💟', '💌'];

  return (
    <motion.div
      className="love-button-container"
      initial={{ scale: 0, opacity: 0 }}
      animate={{ scale: 1, opacity: 1 }}
      transition={{ duration: 0.6, delay: 2, type: "spring", stiffness: 200 }}
    >
      {/* Sparkle effects */}
      {showSparkles && (
        <>
          {[...Array(8)].map((_, i) => (
            <motion.div
              key={i}
              className="sparkle"
              initial={{ 
                scale: 0, 
                opacity: 1,
                x: 0,
                y: 0
              }}
              animate={{ 
                scale: [0, 1, 0],
                opacity: [1, 1, 0],
                x: Math.cos(i * 45 * Math.PI / 180) * 100,
                y: Math.sin(i * 45 * Math.PI / 180) * 100
              }}
              transition={{ 
                duration: 1,
                ease: "easeOut"
              }}
              style={{
                position: 'absolute',
                fontSize: '1.5rem',
                zIndex: 1000
              }}
            >
              {['✨', '💫', '⭐', '🌟', '💎', '🎀', '🌸', '🌺'][i]}
            </motion.div>
          ))}
        </>
      )}

      <motion.button
        className={`love-button ${isPressed ? 'pressed' : ''}`}
        onClick={handleClick}
        whileHover={{ 
          scale: 1.15,
          rotate: [0, -5, 5, -5, 0],
          transition: { duration: 0.4, type: "spring" }
        }}
        whileTap={{ scale: 0.85 }}
        animate={isPressed ? {
          scale: [1, 1.3, 1],
          rotate: [0, 10, -10, 0],
          transition: { duration: 0.4, type: "spring" }
        } : {}}
        style={{
          position: 'relative',
          overflow: 'visible'
        }}
      >
        {/* Button glow effect */}
        <motion.div
          className="button-glow"
          animate={{
            boxShadow: [
              '0 0 20px rgba(255, 20, 147, 0.6)',
              '0 0 40px rgba(255, 20, 147, 0.8)',
              '0 0 20px rgba(255, 20, 147, 0.6)'
            ]
          }}
          transition={{
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut"
          }}
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            borderRadius: '50%',
            zIndex: -1
          }}
        />

        <motion.div
          className="heart-icon"
          animate={{
            scale: [1, 1.1, 1],
            rotate: [0, 3, -3, 0]
          }}
          transition={{
            duration: 2.5,
            repeat: Infinity,
            ease: "easeInOut"
          }}
          style={{
            fontSize: '3rem',
            marginBottom: '10px',
            filter: 'drop-shadow(0 2px 8px rgba(255, 20, 147, 0.5))'
          }}
        >
          {emojis[Math.floor(Math.random() * emojis.length)]}
        </motion.div>

        <motion.div
          className="button-text"
          initial={{ opacity: 0, y: 15 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 2.5, type: "spring" }}
          style={{
            fontSize: '1.1rem',
            fontWeight: '600',
            color: '#fff',
            textShadow: '0 2px 4px rgba(0,0,0,0.3)',
            lineHeight: '1.3',
            textAlign: 'center'
          }}
        >
          รบกวนเบบี๋มากดตงนิ ⎛⎝( ` ᢍ ´ )⎠⎞ᵐᵘʰᵃʰᵃ
        </motion.div>

        {/* Floating hearts around button */}
        <motion.div
          className="floating-hearts-around"
          animate={{
            rotate: 360
          }}
          transition={{
            duration: 20,
            repeat: Infinity,
            ease: "linear"
          }}
          style={{
            position: 'absolute',
            top: '-20px',
            left: '-20px',
            right: '-20px',
            bottom: '-20px',
            pointerEvents: 'none'
          }}
        >
          {[...Array(6)].map((_, i) => (
            <motion.div
              key={i}
              style={{
                position: 'absolute',
                fontSize: '1rem',
                color: '#ff69b4',
                filter: 'drop-shadow(0 0 5px rgba(255, 105, 180, 0.6))'
              }}
              animate={{
                opacity: [0.5, 1, 0.5],
                scale: [0.8, 1.2, 0.8]
              }}
              transition={{
                duration: 3,
                repeat: Infinity,
                delay: i * 0.5,
                ease: "easeInOut"
              }}
            >
              {['💕', '💖', '💗', '💓', '💝', '💘'][i]}
            </motion.div>
          ))}
        </motion.div>
      </motion.button>
    </motion.div>
  );
};

export default LoveButton;
